import React from 'react';
import MyPic from '../assets/pic.jpg';
import './Home.css'

function Home() {
  return (
    <div className='box'>
        <h2>Who is <h2 className='name-high'> Ankit</h2></h2>
        <img className='pic' src={MyPic} alt='My Pic' height={'400px'}/>
    </div>
  )
}

export default Home;
